import React from "react";
import "./Polaroid.css";

function Polaroid({ texte, src }) {
  return (
    <div class="polaroid">
      <img
        src={src}
        alt="Castle"
        style={{ width: "13vw", borderRadius: "8px" }}
      />
      <div className="container">
        <p>{texte}</p>
      </div>
    </div>
  );
}

export default Polaroid;
